import React, {Component} from "react";
import Footer from "./footer";

class AdminPage extends Component {
    state = {
        toggle: false
    };


    render() {
        return (
            <React.Fragment>
                <div className="fillPage">
                    <div className="row">
                        <div className="col-md-2 bg-secondary text-center">
                            <h3>Actions:</h3>
                            <button className="btn btn-light btn-md m-2">
                                Add New Admin
                            </button><br/>
                            <button className="btn btn-light btn-md m-2">
                                Add New Product
                            </button>
                        </div>
                        <div className="col-md-10">

                        </div>
                    </div>
                </div>
                <Footer toggle_admin = {this.props.toggle_admin}/>
            </React.Fragment>
        );
    }
}

export default AdminPage;
